;var clockobj = clockobj || {}
clockobj.utc = clockobj.utc || false;
clockobj.military = clockobj.military || false;
clockobj.currentTime = "";
if (clockobj.show == null) {
    clockobj.show = true;
}

//Global Variables
var currenttime = "";



//Clock
function updateClock() {
       var currentTime = new Date();
       var currentHours = currentTime.getHours();
       var currentMinutes = currentTime.getMinutes();
       var currentSeconds = currentTime.getSeconds();

       if (clockobj.utc) {
           var currentHours = currentTime.getUTCHours();
           var currentMinutes = currentTime.getUTCMinutes();
           var currentSeconds = currentTime.getUTCSeconds();
       }

    // Pad the minutes and seconds with leading zeros, if required
    currentMinutes = (currentMinutes < 10 ? "0" : "") + currentMinutes;
    currentSeconds = (currentSeconds < 10 ? "0" : "") + currentSeconds;
       if (!clockobj.military){
           // Choose either "AM" or "PM" as appropriate
           var timeOfDay = (currentHours < 12) ? " AM" : " PM";
           // Convert the hours component to 12-hour format if needed
           currentHours = (currentHours > 12) ? currentHours - 12 : currentHours;
           // Convert an hours component of "0" to "12"
           currentHours = (currentHours == 0) ? 12 : currentHours;
       } else {
           var timeOfDay = "";
       }
    // Compose the string for display
    var currentTimeString = currentHours + ":" + currentMinutes;
       if (clockobj.currentTime != currentTimeString && clockobj.show){
           clockobj.currentTime  = currentTimeString;
           //$("#clock").html(currentTimeString + '<span style="font-size:25px;">' + timeOfDay + '</span>');
           $("#clock").html(currentTimeString + '<span">' + timeOfDay + '</span>');
       }

       if (!clockobj.show){
           $("#clock").text("");
       }
}



//Document Ready Functions
$(document).ready(function () {
    if ($("#clock").length > 0){
        setInterval(function () { updateClock() }, 100);
    }
});



;
try {
	var clockobj = clockobj || {};
	var tbswitch = document.getElementById("setting-toolbar-switch");
	var widgetswitch = document.getElementById("setting-widget-switch");
	var time24switch = document.getElementById("setting-time24-switch");
	var timeutcswitch = document.getElementById("setting-timeutc-switch");
	var timeshowswitch = document.getElementById("setting-showtime-switch");
	if ((localStorage.getItem("toolbar") == 'false')) {
		tbswitch.checked = false;
	}
	if ((localStorage.getItem("24hourclock") == 'true')) {
		time24switch.checked = true;
	}
	if ((localStorage.getItem("utc") == 'true')) {
		timeutcswitch.checked = true;
	}
	if ((localStorage.getItem("showclock") == 'false')) {
		timeshowswitch.checked = false;
	}
	tbswitch.addEventListener("change", function (e) {
		if (this.checked) {
			document.getElementsByTagName("header")[0].style.display = "block";
			localStorage.setItem("toolbar", true);
		} else {
			document.getElementsByTagName("header")[0].style.display = "none";
			localStorage.setItem("toolbar", false);
		}

	});
	if (widgetswitch) {
		widgetswitch.addEventListener("change", function (e) {
			var widget = document.querySelector('.trending-content') || document.querySelector('.widget-wrapper') || document.querySelector('#widget-container');
			
			if (widget) {
				this.checked ? widget.classList.remove('minimized') : widget.classList.add('minimized');
			}
			
			if (this.checked) {
				document.getElementById("setting-content").style.display = "none";
			}
			
			var date = new Date();
			date.setTime(date.getTime() + (365 * 24 * 60 * 60 * 1000));
			document.cookie = 'widget_closed=' + !this.checked + '; Path=/; Expires=' + date.toUTCString() + '; SameSite=None; Secure';

			SendImpressionGlobal(!this.checked ? 'widget_toggled_hide' : 'widget_toggled_show', '', '');
		});
	}


	time24switch.addEventListener("change", function (e) {
		if (this.checked) {
			clockobj.military = true;
			localStorage.setItem("24hourclock", true);
		}
		else {
			clockobj.military = false;
			localStorage.setItem("24hourclock", false);
		}

	});

	timeutcswitch.addEventListener("change", function (e) {
		if (this.checked) {
			clockobj.utc = true;
			localStorage.setItem("utc", true);
		} else {
			clockobj.utc = false;
			localStorage.setItem("utc", false);
		}

	});


	timeshowswitch.addEventListener("change", function (e) {
		if (this.checked) {
			clockobj.show = true;
			clockobj.currentTime = "";
			localStorage.setItem("showclock", true);
		} else {
			clockobj.show = false;
			localStorage.setItem("showclock", false);
		}

	});

	function hide() {
		var setting = document.getElementsByClassName("setting-feature-forms");
		for (i = 0; i < setting.length; i++) {
			setting[i].style.display = "none";
		}
	}
	var pickformat = document.getElementsByName("weatherfomart");
	var weatherformating = webHelpers.getCookie("wc");

	if (weatherformating != null && weatherformating != '') {
		for (i = 0; i < pickformat.length; i++) {
			pickformat[i].checked = (pickformat[i].value == 'celsius' && weatherformating == 'c') || (pickformat[i].value == 'fahrenheit' && weatherformating == 'f')
		}
	}

	document.getElementById("setting-zipcode-value").value = webHelpers.getCookie("zipcode");
	var features = document.getElementById("settings-list-features").children;
	for (i = 0; i < features.length; i++) {
		features[i].addEventListener("click", function (e) {
			for (i = 0; i < features.length; i++) {
				features[i].className = "";
			}
			hide();
			e.target.className = "selected";
			var id = "setting-" + e.target.innerHTML.toLowerCase() + "-form"
			var element = document.getElementById(id);
			if (element != null) {
				element.style.display = "block";
			}
		});
	}

	function settingSave() {
		var originalFormat = webHelpers.getCookie("wc") || "f";
		for (i = 0; i < pickformat.length; i++) {
			if (pickformat[i].checked && pickformat[i].value == 'celsius') {
				weatherHelper.format = "c";
				webHelpers.setCookie("wc", "c", 150);
			} else {
				weatherHelper.format = "f";
				webHelpers.setCookie("wc", "f", 150);
			}
		}
		var zip = document.getElementById("setting-zipcode-value");
		if (zip.value != webHelpers.getCookie("zipcode") || originalFormat != weatherHelper.format) {
			if (zip != '' && zip !== null && zip.value.trim() !== '') {
				weatherHelper2.GetWeatherDataByZipcode(zip.value);
				webHelpers.setCookie("zipcode", zip.value, 120);
			} else {
				var oldvalue = webHelpers.getCookie("zipcode")
				if (oldvalue.trim() != '' && oldvalue !== null) {
					zip.value = webHelpers.getCookie("zipcode")
				}

			}
		}
	}
	var icon = document.getElementById("settings-icon");
	var closing = document.getElementById('setting-close')

	closing.addEventListener("click", function () {
		document.getElementById("setting-content").style.display = "none";
	});

	icon.addEventListener("click", function () {
		document.getElementById("setting-content").style.display = "block";
		SendImpressionGlobal("ex_setting_opened");
	});
} catch (e) {
	//console.log(e);
}
;